Ext.data.JsonP.Date({"mixins":[],"code_type":"nop","inheritable":false,"component":false,"meta":{},"mixedInto":[],"uses":[],"aliases":{},"parentMixins":[],"supercl***REMOVED***es":[],"members":{"event":[],"property":[],"css_var":[],"method":[{"meta":{},"owner":"Date","tagname":"method","name":"constructor","id":"method-constructor"},{"meta":{},"owner":"Date","tagname":"method","name":"getDate","id":"method-getDate"},{"meta":{},"owner":"Date","tagname":"method","name":"getDay","id":"method-getDay"},{"meta":{},"owner":"Date","tagname":"method","name":"getFullYear","id":"method-getFullYear"},{"meta":{},"owner":"Date","tagname":"method","name":"getHours","id":"method-getHours"},{"meta":{},"owner":"Date","tagname":"method","name":"getMilliseconds","id":"method-getMilliseconds"},{"meta":{},"owner":"Date","tagname":"method","name":"getMinutes","id":"method-getMinutes"},{"meta":{},"owner":"Date","tagname":"method","name":"getMonth","id":"method-getMonth"},{"meta":{},"owner":"Date","tagname":"method","name":"getSeconds","id":"method-getSeconds"},{"meta":{},"owner":"Date","tagname":"method","name":"getTime","id":"method-getTime"},{"meta":{},"owner":"Date","tagname":"method","name":"getTimezoneOffset","id":"method-getTimezoneOffset"},{"meta":{},"owner":"Date","tagname":"method","name":"getUTCDate","id":"method-getUTCDate"},{"meta":{},"owner":"Date","tagname":"method","name":"getUTCDay","id":"method-getUTCDay"},{"meta":{},"owner":"Date","tagname":"method","name":"getUTCFullYear","id":"method-getUTCFullYear"},{"meta":{},"owner":"Date","tagname":"method","name":"getUTCHours","id":"method-getUTCHours"},{"meta":{},"owner":"Date","tagname":"method","name":"getUTCMilliseconds","id":"method-getUTCMilliseconds"},{"meta":{},"owner":"Date","tagname":"method","name":"getUTCMinutes","id":"method-getUTCMinutes"},{"meta":{},"owner":"Date","tagname":"method","name":"getUTCMonth","id":"method-getUTCMonth"},{"meta":{},"owner":"Date","tagname":"method","name":"getUTCSeconds","id":"method-getUTCSeconds"},{"meta":{},"owner":"Date","tagname":"method","name":"setDate","id":"method-setDate"},{"meta":{},"owner":"Date","tagname":"method","name":"setFullYear","id":"method-setFullYear"},{"meta":{},"owner":"Date","tagname":"method","name":"setHours","id":"method-setHours"},{"meta":{},"owner":"Date","tagname":"method","name":"setMilliseconds","id":"method-setMilliseconds"},{"meta":{},"owner":"Date","tagname":"method","name":"setMinutes","id":"method-setMinutes"},{"meta":{},"owner":"Date","tagname":"method","name":"setMonth","id":"method-setMonth"},{"meta":{},"owner":"Date","tagname":"method","name":"setSeconds","id":"method-setSeconds"},{"meta":{},"owner":"Date","tagname":"method","name":"setTime","id":"method-setTime"},{"meta":{},"owner":"Date","tagname":"method","name":"setUTCDate","id":"method-setUTCDate"},{"meta":{},"owner":"Date","tagname":"method","name":"setUTCFullYear","id":"method-setUTCFullYear"},{"meta":{},"owner":"Date","tagname":"method","name":"setUTCHours","id":"method-setUTCHours"},{"meta":{},"owner":"Date","tagname":"method","name":"setUTCMilliseconds","id":"method-setUTCMilliseconds"},{"meta":{},"owner":"Date","tagname":"method","name":"setUTCMinutes","id":"method-setUTCMinutes"},{"meta":{},"owner":"Date","tagname":"method","name":"setUTCMonth","id":"method-setUTCMonth"},{"meta":{},"owner":"Date","tagname":"method","name":"setUTCSeconds","id":"method-setUTCSeconds"},{"meta":{},"owner":"Date","tagname":"method","name":"toDateString","id":"method-toDateString"},{"meta":{},"owner":"Date","tagname":"method","name":"toLocaleDateString","id":"method-toLocaleDateString"},{"meta":{},"owner":"Date","tagname":"method","name":"toLocaleString","id":"method-toLocaleString"},{"meta":{},"owner":"Date","tagname":"method","name":"toLocaleTimeString","id":"method-toLocaleTimeString"},{"meta":{},"owner":"Date","tagname":"method","name":"toString","id":"method-toString"},{"meta":{},"owner":"Date","tagname":"method","name":"toTimeString","id":"method-toTimeString"},{"meta":{},"owner":"Date","tagname":"method","name":"toUTCString","id":"method-toUTCString"},{"meta":{},"owner":"Date","tagname":"method","name":"valueOf","id":"method-valueOf"}],"css_mixin":[],"cfg":[]},"tagname":"cl***REMOVED***","extends":null,"html":"<div><pre cl***REMOVED***=\"hierarchy\"><h4>Files</h4><div cl***REMOVED***='dependency'><a href='source/Date.html#Date' target='_blank'>Date.js</a></div></pre><div cl***REMOVED***='doc-contents'><p>Creates <code>Date</code> instances which let you work with dates and times.</p>\n\n<p>If you supply no arguments, the constructor creates a <code>Date</code> object for today's\ndate and time according to local time. If you supply some arguments but not\nothers, the missing arguments are set to 0. If you supply any arguments, you\nmust supply at least the year, month, and day. You can omit the hours, minutes,\nseconds, and milliseconds.</p>\n\n<p>The date is measured in milliseconds since midnight 01 January, 1970 UTC. A day\nholds 86,400,000 milliseconds. The <code>Date</code> object range is -100,000,000 days to\n100,000,000 days relative to 01 January, 1970 UTC.</p>\n\n<p>The <code>Date</code> object provides uniform behavior across platforms.</p>\n\n<p>The <code>Date</code> object supports a number of UTC (universal) methods, as well as\nlocal time methods. UTC, also known as Greenwich Mean Time (GMT), refers to the\ntime as set by the World Time Standard. The local time is the time known to the\ncomputer where JavaScript is executed.</p>\n\n<p>Invoking <code>Date</code> in a non-constructor context (i.e., without the <code>new</code> operator)\nwill return a string representing the current time.</p>\n\n<p>Note that <code>Date</code> objects can only be instantiated by calling <code>Date</code> or using it\nas a constructor; unlike other JavaScript object types, <code>Date</code> objects have no\nliteral syntax.</p>\n\n<h1>Several ways to ***REMOVED***ign dates</h1>\n\n<p>The following example shows several ways to ***REMOVED***ign dates:</p>\n\n<pre><code>today = new Date();\nbirthday = new Date(\"December 19, 1989 03:24:00\");\nbirthday = new Date(1989,11,19);\nbirthday = new Date(1989,11,17,3,24,0);\n</code></pre>\n\n<h1>Calculating elapsed time</h1>\n\n<p>The following examples show how to determine the elapsed time between two dates:</p>\n\n<pre><code>// using static methods\nvar start = <a href=\"#!/api/Date-static-method-now\" rel=\"Date-static-method-now\" cl***REMOVED***=\"docCl***REMOVED***\">Date.now</a>();\n// the event you'd like to time goes here:\ndoSomethingForALongTime();\nvar end = <a href=\"#!/api/Date-static-method-now\" rel=\"Date-static-method-now\" cl***REMOVED***=\"docCl***REMOVED***\">Date.now</a>();\nvar elapsed = end - start; // time in milliseconds\n\n// if you have Date objects\nvar start = new Date();\n// the event you'd like to time goes here:\ndoSomethingForALongTime();\nvar end = new Date();\nvar elapsed = end.getTime() - start.getTime(); // time in milliseconds\n\n// if you want to test a function and get back its return\nfunction printElapsedTime (fTest) {\n    var nStartTime = <a href=\"#!/api/Date-static-method-now\" rel=\"Date-static-method-now\" cl***REMOVED***=\"docCl***REMOVED***\">Date.now</a>(), vReturn = fTest(), nEndTime = <a href=\"#!/api/Date-static-method-now\" rel=\"Date-static-method-now\" cl***REMOVED***=\"docCl***REMOVED***\">Date.now</a>();\n    alert(\"Elapsed time: \" + String(nEndTime - nStartTime) + \"\n    milliseconds\");\n    return vReturn;\n}\n\nyourFunctionReturn = printElapsedTime(yourFunction);\n</code></pre>\n\n<h1>ISO 8601 formatted dates</h1>\n\n<p>The following example shows how to formate a date in an ISO 8601 format using\nUTC:</p>\n\n<pre><code>// use a function for the exact format desired...\nfunction ISODateString(d){\nfunction pad(n){return n&lt;10 ? '0'+n : n}\nreturn d.getUTCFullYear()+'-'\n    + pad(d.getUTCMonth()+1)+'-'\n    + pad(d.getUTCDate())+'T'\n    + pad(d.getUTCHours())+':'\n    + pad(d.getUTCMinutes())+':'\n    + pad(d.getUTCSeconds())+'Z'}\n\nvar d = new Date();\nprint(ISODateString(d)); // prints something like 2009-09-28T19:03:12Z\n</code></pre>\n\n<div cl***REMOVED***=\"notice\">\nDocumentation for this cl***REMOVED*** comes from <a href=\"https://developer.mozilla.org/en/JavaScript/Reference/Global_Objects/Date\">MDN</a>\nand is available under <a href=\"http://creativecommons.org/licenses/by-sa/2.0/\">Creative Commons: Attribution-Sharealike license</a>.\n</div>\n\n</div><div cl***REMOVED***='members'><div cl***REMOVED***='members-section'><h3 cl***REMOVED***='members-title icon-method'>Methods</h3><div cl***REMOVED***='subsection'><div cl***REMOVED***='definedBy'>Defined By</div><h4 cl***REMOVED***='members-subtitle'>Instance Methods</h3><div id='method-constructor' cl***REMOVED***='member first-child not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-constructor' target='_blank' cl***REMOVED***='view-source'>view source</a></div><strong cl***REMOVED***='new-keyword'>new</strong><a href='#!/api/Date-method-constructor' cl***REMOVED***='name expandable'>Date</a>( <span cl***REMOVED***='pre'>[<a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a>/<a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a> year], [<a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> month], [<a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> day], [<a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> hour], [<a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> minute], [<a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> second], [<a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> millisecond]</span> ) : <a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Creates new Date object. ...</div><div cl***REMOVED***='long'><p>Creates new Date object.</p>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>year</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a>/<a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a> (optional)<div cl***REMOVED***='sub-desc'><p>Either UNIX timestamp, date string, or year (when month and day parameters also provided):</p>\n\n<ul>\n<li><p>Integer value representing the number of milliseconds since 1 January 1970\n00:00:00 UTC (Unix Epoch).</p></li>\n<li><p>String value representing a date. The string should be in a format recognized\nby the parse method (IETF-compliant RFC 1123 timestamps).</p></li>\n<li><p>Integer value representing the year. For compatibility (in order to avoid the\nY2K problem), you should always specify the year in full; use 1998, rather\nthan 98.</p></li>\n</ul>\n\n</div></li><li><span cl***REMOVED***='pre'>month</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> (optional)<div cl***REMOVED***='sub-desc'><p>Integer value representing the month, beginning with 0 for January to 11\nfor December.</p>\n</div></li><li><span cl***REMOVED***='pre'>day</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> (optional)<div cl***REMOVED***='sub-desc'><p>Integer value representing the day of the month (1-31).</p>\n</div></li><li><span cl***REMOVED***='pre'>hour</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> (optional)<div cl***REMOVED***='sub-desc'><p>Integer value representing the hour of the day (0-23).</p>\n</div></li><li><span cl***REMOVED***='pre'>minute</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> (optional)<div cl***REMOVED***='sub-desc'><p>Integer value representing the minute segment (0-59) of a time reading.</p>\n</div></li><li><span cl***REMOVED***='pre'>second</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> (optional)<div cl***REMOVED***='sub-desc'><p>Integer value representing the second segment (0-59) of a time reading.</p>\n</div></li><li><span cl***REMOVED***='pre'>millisecond</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> (optional)<div cl***REMOVED***='sub-desc'><p>Integer value representing the millisecond segment (0-999) of a time reading.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a></span><div cl***REMOVED***='sub-desc'>\n</div></li></ul></div></div></div><div id='method-getDate' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getDate' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getDate' cl***REMOVED***='name expandable'>getDate</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The second statement below ***REMOVED***igns the value 25 to the variable <code>day</code>, based on the value of the\n<code>Date</code> object <code>Xmas95</code>.</p>\n\n<pre><code>Xmas95 = new Date(\"December 25, 1995 23:15:00\")\nday = Xmas95.getDate()\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Value between 1 and 31.</p>\n</div></li></ul></div></div></div><div id='method-getDay' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getDay' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getDay' cl***REMOVED***='name expandable'>getDay</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The value returned by <code>getDay</code> is an integer corresponding to the day of the week: 0 for Sunday, 1\nfor Monday, 2 for Tuesday, and so on.</p>\n\n<p>The second statement below ***REMOVED***igns the value 1 to <code>weekday</code>, based on the value of the <code>Date</code>\nobject <code>Xmas95</code>. December 25, 1995, is a Monday.</p>\n\n<pre><code>Xmas95 = new Date(\"December 25, 1995 23:15:00\");\nweekday = Xmas95.getDay();\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>A numeric representation of the day from Sunday (0) to\nSaturday (6).</p>\n</div></li></ul></div></div></div><div id='method-getFullYear' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getFullYear' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getFullYear' cl***REMOVED***='name expandable'>getFullYear</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The value returned by <code>getFullYear</code> is an absolute number. For dates between the years 1000 and\n9999, <code>getFullYear</code> returns a four-digit number, for example, 1995. Use this function to make sure\na year is compliant with years after 2000.</p>\n\n<p>Use this method instead of the <code>getYear</code> method.</p>\n\n<p>The following example ***REMOVED***igns the four-digit value of the current year to the variable yr.</p>\n\n<pre><code>var today = new Date();\nvar yr = today.getFullYear();\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Four digit representation of the year.</p>\n</div></li></ul></div></div></div><div id='method-getHours' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getHours' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getHours' cl***REMOVED***='name expandable'>getHours</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The second statement below ***REMOVED***igns the value 23 to the variable <code>hours</code>, based on the value of the\n<code>Date</code> object <code>Xmas95</code>.</p>\n\n<pre><code>Xmas95 = new Date(\"December 25, 1995 23:15:00\")\nhours = Xmas95.getHours()\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Value between 0 and 23, using 24-hour clock.</p>\n</div></li></ul></div></div></div><div id='method-getMilliseconds' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getMilliseconds' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getMilliseconds' cl***REMOVED***='name expandable'>getMilliseconds</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The following example ***REMOVED***igns the milliseconds portion of the current time to the variable ms.</p>\n\n<pre><code>var ms;\nToday = new Date();\nms = Today.getMilliseconds();\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>A number between 0 and 999.</p>\n</div></li></ul></div></div></div><div id='method-getMinutes' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getMinutes' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getMinutes' cl***REMOVED***='name expandable'>getMinutes</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The second statement below ***REMOVED***igns the value 15 to the variable <code>minutes</code>, based on the value of\nthe <code>Date</code> object <code>Xmas95</code>.</p>\n\n<pre><code>Xmas95 = new Date(\"December 25, 1995 23:15:00\")\nminutes = Xmas95.getMinutes()\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Value between 0 and 59.</p>\n</div></li></ul></div></div></div><div id='method-getMonth' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getMonth' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getMonth' cl***REMOVED***='name expandable'>getMonth</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The second statement below ***REMOVED***igns the value 11 to the variable <code>month</code>, based on the value of the\n<code>Date</code> object <code>Xmas95</code>.</p>\n\n<pre><code>Xmas95 = new Date(\"December 25, 1995 23:15:00\")\nmonth = Xmas95.getMonth()\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 11. 0 corresponds to January, 1 to February, and so on.</p>\n</div></li></ul></div></div></div><div id='method-getSeconds' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getSeconds' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getSeconds' cl***REMOVED***='name expandable'>getSeconds</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The second statement below ***REMOVED***igns the value 30 to the variable <code>secs</code>, based on the value of the\n<code>Date</code> object <code>Xmas95</code>.</p>\n\n<pre><code>Xmas95 = new Date(\"December 25, 1995 23:15:30\")\nsecs = Xmas95.getSeconds()\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Value between 0 and 59.</p>\n</div></li></ul></div></div></div><div id='method-getTime' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getTime' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getTime' cl***REMOVED***='name expandable'>getTime</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The value returned by the <code>getTime</code> method is the number of milliseconds since 1 January 1970\n00:00:00 UTC. You can use this method to help ***REMOVED***ign a date and time to another <code>Date</code> object.</p>\n\n<p>This method is functionally equivalent to the <code>valueOf</code> method.</p>\n\n<p>Using getTime for copying dates</p>\n\n<p>Constructing a date object with the identical time value.</p>\n\n<pre><code>var birthday = new Date(1994, 12, 10);\nvar copy = new Date();\ncopy.setTime(birthday.getTime());\n</code></pre>\n\n<p>Measuring execution time</p>\n\n<p>Subtracting two subsequent getTime calls on newly generated Date objects, give the time span\nbetween these two calls. This can be used to calculate the executing time of some operations.</p>\n\n<pre><code>var end, start;\n\nstart = new Date();\nfor (var i = 0; i &lt; 1000; i++)\n    Math.sqrt(i);\nend = new Date();\n\nconsole.log(\"Operation took \" + (end.getTime() - start.getTime()) + \" msec\");\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Number of milliseconds since 1/1/1970 (GMT).</p>\n</div></li></ul></div></div></div><div id='method-getTimezoneOffset' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getTimezoneOffset' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getTimezoneOffset' cl***REMOVED***='name expandable'>getTimezoneOffset</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The time-zone offset is the difference, in minutes, between UTC and local time. Note that this\nmeans that the offset is positive if the local timezone is behind UTC and negative if it is ahead.\nFor example, if your time zone is UTC+10 (Australian Eastern Standard Time), -600 will be returned.\nDaylight savings time prevents this value from being a constant even for a given locale</p>\n\n<pre><code>x = new Date()\ncurrentTimeZoneOffsetInHours = x.getTimezoneOffset()/60\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Minutes between GMT and local time.</p>\n</div></li></ul></div></div></div><div id='method-getUTCDate' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getUTCDate' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getUTCDate' cl***REMOVED***='name expandable'>getUTCDate</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The following example ***REMOVED***igns the day portion of the current date to the variable <code>d</code>.</p>\n\n<pre><code>var d;\nToday = new Date();\nd = Today.getUTCDate();\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Integer between 1 and 31 representing the day.</p>\n</div></li></ul></div></div></div><div id='method-getUTCDay' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getUTCDay' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getUTCDay' cl***REMOVED***='name expandable'>getUTCDay</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The following example ***REMOVED***igns the weekday portion of the current date to the variable <code>weekday</code>.</p>\n\n<pre><code>var weekday;\nToday = new Date()\nweekday = Today.getUTCDay()\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>A numeric representation of the day from Sunday (0) to\nSaturday (6).</p>\n</div></li></ul></div></div></div><div id='method-getUTCFullYear' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getUTCFullYear' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getUTCFullYear' cl***REMOVED***='name expandable'>getUTCFullYear</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The following example ***REMOVED***igns the four-digit value of the current year to the variable <code>yr</code>.</p>\n\n<pre><code>var yr;\nToday = new Date();\nyr = Today.getUTCFullYear();\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Four digit representation of the year.</p>\n</div></li></ul></div></div></div><div id='method-getUTCHours' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getUTCHours' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getUTCHours' cl***REMOVED***='name expandable'>getUTCHours</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The following example ***REMOVED***igns the hours portion of the current time to the variable <code>hrs</code>.</p>\n\n<pre><code>var hrs;\nToday = new Date();\nhrs = Today.getUTCHours();\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Value between 0 and 23.</p>\n</div></li></ul></div></div></div><div id='method-getUTCMilliseconds' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getUTCMilliseconds' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getUTCMilliseconds' cl***REMOVED***='name expandable'>getUTCMilliseconds</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The following example ***REMOVED***igns the milliseconds portion of the current time to the variable <code>ms</code>.</p>\n\n<pre><code>var ms;\nToday = new Date();\nms = Today.getUTCMilliseconds();\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Milliseconds portion of the Date.</p>\n</div></li></ul></div></div></div><div id='method-getUTCMinutes' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getUTCMinutes' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getUTCMinutes' cl***REMOVED***='name expandable'>getUTCMinutes</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The following example ***REMOVED***igns the minutes portion of the current time to the variable <code>min</code>.</p>\n\n<pre><code>var min;\nToday = new Date();\nmin = Today.getUTCMinutes();\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Value between 0 and 59.</p>\n</div></li></ul></div></div></div><div id='method-getUTCMonth' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getUTCMonth' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getUTCMonth' cl***REMOVED***='name expandable'>getUTCMonth</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The following example ***REMOVED***igns the month portion of the current date to the variable <code>mon</code>.</p>\n\n<pre><code>var mon;\nToday = new Date();\nmon = Today.getUTCMonth();\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Value between 0 (January) and 11 (December).</p>\n</div></li></ul></div></div></div><div id='method-getUTCSeconds' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-getUTCSeconds' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-getUTCSeconds' cl***REMOVED***='name expandable'>getUTCSeconds</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The following example ***REMOVED***igns the seconds portion of the current time to the variable <code>sec</code>.</p>\n\n<pre><code>var sec;\nToday = new Date();\nsec = Today.getUTCSeconds();\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Value between 0 and 59.</p>\n</div></li></ul></div></div></div><div id='method-setDate' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-setDate' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-setDate' cl***REMOVED***='name expandable'>setDate</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> dayValue</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Sets the day of the month (1-31) for a specified date according to local time. ...</div><div cl***REMOVED***='long'><p>Sets the day of the month (1-31) for a specified date according to local time.</p>\n\n<p>If the parameter you specify is outside of the expected range, <code>setDate</code> attempts to update the\ndate information in the <code>Date</code> object accordingly. For example, if you use 0 for <code>dayValue</code>, the\ndate will be set to the last day of the previous month.</p>\n\n<p>The second statement below changes the day for theBigDay to July 24 from its original value.</p>\n\n<pre><code>theBigDay = new Date(\"July 27, 1962 23:30:00\")\ntheBigDay.setDate(24)\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>dayValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer from 1 to 31, representing the day of the month.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>New date represented as milliseconds.</p>\n</div></li></ul></div></div></div><div id='method-setFullYear' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-setFullYear' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-setFullYear' cl***REMOVED***='name expandable'>setFullYear</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> yearValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> monthValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> dayValue</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Sets the full year (4 digits for 4-digit years) for a specified date according to\nlocal time. ...</div><div cl***REMOVED***='long'><p>Sets the full year (4 digits for 4-digit years) for a specified date according to\nlocal time.</p>\n\n<p>If you do not specify the <code>monthValue</code> and <code>dayValue</code> parameters, the values returned from the\n<code>getMonth</code> and <code>getDate</code> methods are used.</p>\n\n<p>If a parameter you specify is outside of the expected range, <code>setFullYear</code> attempts to update the\nother parameters and the date information in the <code>Date</code> object accordingly. For example, if you\nspecify 15 for monthValue, the year is incremented by 1 (year + 1), and 3 is used for the month.</p>\n\n<p>theBigDay = new Date();\ntheBigDay.setFullYear(1997);</p>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>yearValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer specifying the numeric value of the year, for example, 1995.</p>\n</div></li><li><span cl***REMOVED***='pre'>monthValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 11 representing the months January through\nDecember.</p>\n</div></li><li><span cl***REMOVED***='pre'>dayValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 1 and 31 representing the day of the month. If you\nspecify the <code>dayValue</code> parameter, you must also specify the <code>monthValue</code>.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>New date represented as milliseconds.</p>\n</div></li></ul></div></div></div><div id='method-setHours' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-setHours' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-setHours' cl***REMOVED***='name expandable'>setHours</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> hoursValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> minutesValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> secondsValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> msValue</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Sets the hours (0-23) for a specified date according to local time. ...</div><div cl***REMOVED***='long'><p>Sets the hours (0-23) for a specified date according to local time.</p>\n\n<p>If you do not specify the <code>minutesValue</code>, <code>secondsValue</code>, and <code>msValue</code> parameters, the values\nreturned from the <code>getUTCMinutes</code>, <code>getUTCSeconds</code>, and <code>getMilliseconds</code> methods are used.</p>\n\n<p>If a parameter you specify is outside of the expected range, setHours attempts to update the date\ninformation in the <code>Date</code> object accordingly. For example, if you use 100 for <code>secondsValue</code>, the\nminutes will be incremented by 1 (min + 1), and 40 will be used for seconds.</p>\n\n<pre><code>theBigDay.setHours(7)\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>hoursValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 23, representing the hour.</p>\n</div></li><li><span cl***REMOVED***='pre'>minutesValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 59, representing the minutes.</p>\n</div></li><li><span cl***REMOVED***='pre'>secondsValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 59, representing the seconds. If you specify the\n<code>secondsValue</code> parameter, you must also specify the <code>minutesValue</code>.</p>\n</div></li><li><span cl***REMOVED***='pre'>msValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>A number between 0 and 999, representing the milliseconds. If you specify the\n<code>msValue</code> parameter, you must also specify the <code>minutesValue</code> and <code>secondsValue</code>.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>New date represented as milliseconds.</p>\n</div></li></ul></div></div></div><div id='method-setMilliseconds' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-setMilliseconds' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-setMilliseconds' cl***REMOVED***='name expandable'>setMilliseconds</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> millisecondsValue</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Sets the milliseconds (0-999) for a specified date according to local time. ...</div><div cl***REMOVED***='long'><p>Sets the milliseconds (0-999) for a specified date according to local time.</p>\n\n<p>If you specify a number outside the expected range, the date information in the <code>Date</code> object is\nupdated accordingly. For example, if you specify 1005, the number of seconds is incremented by 1,\nand 5 is used for the milliseconds.</p>\n\n<pre><code>theBigDay = new Date();\ntheBigDay.setMilliseconds(100);\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>millisecondsValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>A number between 0 and 999, representing the milliseconds.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>New date represented as milliseconds.</p>\n</div></li></ul></div></div></div><div id='method-setMinutes' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-setMinutes' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-setMinutes' cl***REMOVED***='name expandable'>setMinutes</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> minutesValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> secondsValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> msValue</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Sets the minutes (0-59) for a specified date according to local time. ...</div><div cl***REMOVED***='long'><p>Sets the minutes (0-59) for a specified date according to local time.</p>\n\n<p>If you do not specify the <code>secondsValue</code> and <code>msValue</code> parameters, the values returned from\n<code>getSeconds</code> and <code>getMilliseconds</code> methods are used.</p>\n\n<p>If a parameter you specify is outside of the expected range, <code>setMinutes</code> attempts to update the\ndate information in the <code>Date</code> object accordingly. For example, if you use 100 for <code>secondsValue</code>,\nthe minutes (<code>minutesValue</code>) will be incremented by 1 (minutesValue + 1), and 40 will be used for\nseconds.</p>\n\n<pre><code>theBigDay.setMinutes(45)\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>minutesValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 59, representing the minutes.</p>\n</div></li><li><span cl***REMOVED***='pre'>secondsValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 59, representing the seconds. If you\nspecify the secondsValue parameter, you must also specify the <code>minutesValue</code>.</p>\n</div></li><li><span cl***REMOVED***='pre'>msValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>A number between 0 and 999, representing the milliseconds. If you specify\nthe <code>msValue</code> parameter, you must also specify the <code>minutesValue</code> and <code>secondsValue</code>.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>New date represented as milliseconds.</p>\n</div></li></ul></div></div></div><div id='method-setMonth' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-setMonth' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-setMonth' cl***REMOVED***='name expandable'>setMonth</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> monthValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> dayValue</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Sets the month (0-11) for a specified date according to local time. ...</div><div cl***REMOVED***='long'><p>Sets the month (0-11) for a specified date according to local time.</p>\n\n<p>If you do not specify the <code>dayValue</code> parameter, the value returned from the <code>getDate</code> method is\nused.</p>\n\n<p>If a parameter you specify is outside of the expected range, <code>setMonth</code> attempts to update the date\ninformation in the <code>Date</code> object accordingly. For example, if you use 15 for <code>monthValue</code>, the year\nwill be incremented by 1 (year + 1), and 3 will be used for month.</p>\n\n<pre><code>theBigDay.setMonth(6)\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>monthValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 11 (representing the months January through\nDecember).</p>\n</div></li><li><span cl***REMOVED***='pre'>dayValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer from 1 to 31, representing the day of the month.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>New date represented as milliseconds.</p>\n</div></li></ul></div></div></div><div id='method-setSeconds' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-setSeconds' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-setSeconds' cl***REMOVED***='name expandable'>setSeconds</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> secondsValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> msValue</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Sets the seconds (0-59) for a specified date according to local time. ...</div><div cl***REMOVED***='long'><p>Sets the seconds (0-59) for a specified date according to local time.</p>\n\n<p>If you do not specify the <code>msValue</code> parameter, the value returned from the <code>getMilliseconds</code> method\nis used.</p>\n\n<p>If a parameter you specify is outside of the expected range, <code>setSeconds</code> attempts to update the\ndate information in the <code>Date</code> object accordingly. For example, if you use 100 for <code>secondsValue</code>,\nthe minutes stored in the <code>Date</code> object will be incremented by 1, and 40 will be used for seconds.</p>\n\n<pre><code>theBigDay.setSeconds(30)\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>secondsValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 59.</p>\n</div></li><li><span cl***REMOVED***='pre'>msValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>A number between 0 and 999, representing the milliseconds. If you specify\nthe<code>msValue</code> parameter, you must also specify the <code>minutesValue</code> and <code>secondsValue</code>.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>New date represented as milliseconds.</p>\n</div></li></ul></div></div></div><div id='method-setTime' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-setTime' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-setTime' cl***REMOVED***='name expandable'>setTime</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> timeValue</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Sets the Date object to the time represented by a number of milliseconds since\nJanuary 1, 1970, 00:00:00 UTC, allowin...</div><div cl***REMOVED***='long'><p>Sets the Date object to the time represented by a number of milliseconds since\nJanuary 1, 1970, 00:00:00 UTC, allowing for negative numbers for times prior.</p>\n\n<p>Use the <code>setTime</code> method to help ***REMOVED***ign a date and time to another <code>Date</code> object.</p>\n\n<pre><code>theBigDay = new Date(\"July 1, 1999\")\***REMOVED***meAsBigDay = new Date()\***REMOVED***meAsBigDay.setTime(theBigDay.getTime())\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>timeValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer representing the number of milliseconds since 1 January\n1970, 00:00:00 UTC.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>New date represented as milliseconds.</p>\n</div></li></ul></div></div></div><div id='method-setUTCDate' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-setUTCDate' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-setUTCDate' cl***REMOVED***='name expandable'>setUTCDate</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> dayValue</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Sets the day of the month (1-31) for a specified date according to universal time. ...</div><div cl***REMOVED***='long'><p>Sets the day of the month (1-31) for a specified date according to universal time.</p>\n\n<p>If a parameter you specify is outside of the expected range, <code>setUTCDate</code> attempts to update the\ndate information in the <code>Date</code> object accordingly. For example, if you use 40 for <code>dayValue</code>, and\nthe month stored in the <code>Date</code> object is June, the day will be changed to 10 and the month will be\nincremented to July.</p>\n\n<pre><code>theBigDay = new Date();\ntheBigDay.setUTCDate(20);\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>dayValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer from 1 to 31, representing the day of the month.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>New date represented as milliseconds.</p>\n</div></li></ul></div></div></div><div id='method-setUTCFullYear' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-setUTCFullYear' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-setUTCFullYear' cl***REMOVED***='name expandable'>setUTCFullYear</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> yearValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> monthValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> dayValue</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Sets the full year (4 digits for 4-digit years) for a specified date according\nto universal time. ...</div><div cl***REMOVED***='long'><p>Sets the full year (4 digits for 4-digit years) for a specified date according\nto universal time.</p>\n\n<p>If you do not specify the <code>monthValue</code> and <code>dayValue</code> parameters, the values returned from the\n<code>getMonth</code> and <code>getDate</code> methods are used.</p>\n\n<p>If a parameter you specify is outside of the expected range, <code>setUTCFullYear</code> attempts to update\nthe other parameters and the date information in the <code>Date</code> object accordingly. For example, if you\nspecify 15 for <code>monthValue</code>, the year is incremented by 1 (year + 1), and 3 is used for the month.</p>\n\n<pre><code>theBigDay = new Date();\ntheBigDay.setUTCFullYear(1997);\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>yearValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer specifying the numeric value of the year, for example, 1995.</p>\n</div></li><li><span cl***REMOVED***='pre'>monthValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 11 representing the months January through\nDecember.</p>\n</div></li><li><span cl***REMOVED***='pre'>dayValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 1 and 31 representing the day of the month. If you\nspecify the <code>dayValue</code> parameter, you must also specify the <code>monthValue</code>.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>New date represented as milliseconds.</p>\n</div></li></ul></div></div></div><div id='method-setUTCHours' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-setUTCHours' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-setUTCHours' cl***REMOVED***='name expandable'>setUTCHours</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> hoursValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> minutesValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> secondsValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> msValue</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Sets the hour (0-23) for a specified date according to universal time. ...</div><div cl***REMOVED***='long'><p>Sets the hour (0-23) for a specified date according to universal time.</p>\n\n<p>If you do not specify the <code>minutesValue</code>, <code>secondsValue</code>, and <code>msValue</code> parameters, the values\nreturned from the <code>getUTCMinutes</code>, <code>getUTCSeconds</code>, and <code>getUTCMilliseconds</code> methods are used.</p>\n\n<p>If a parameter you specify is outside of the expected range, <code>setUTCHours</code> attempts to update the\ndate information in the <code>Date</code> object accordingly. For example, if you use 100 for <code>secondsValue</code>,\nthe minutes will be incremented by 1 (min + 1), and 40 will be used for seconds.</p>\n\n<pre><code>theBigDay = new Date();\ntheBigDay.setUTCHours(8);\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>hoursValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 23, representing the hour.</p>\n</div></li><li><span cl***REMOVED***='pre'>minutesValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 59, representing the minutes.</p>\n</div></li><li><span cl***REMOVED***='pre'>secondsValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 59, representing the seconds. If you specify the\n<code>secondsValue</code> parameter, you must also specify the <code>minutesValue</code>.</p>\n</div></li><li><span cl***REMOVED***='pre'>msValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>A number between 0 and 999, representing the milliseconds. If you specify the\n<code>msValue</code> parameter, you must also specify the <code>minutesValue</code> and <code>secondsValue</code>.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>New date represented as milliseconds.</p>\n</div></li></ul></div></div></div><div id='method-setUTCMilliseconds' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-setUTCMilliseconds' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-setUTCMilliseconds' cl***REMOVED***='name expandable'>setUTCMilliseconds</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> millisecondsValue</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Sets the milliseconds (0-999) for a specified date according to universal time. ...</div><div cl***REMOVED***='long'><p>Sets the milliseconds (0-999) for a specified date according to universal time.</p>\n\n<p>If a parameter you specify is outside of the expected range, <code>setUTCMilliseconds</code> attempts to\nupdate the date information in the <code>Date</code> object accordingly. For example, if you use 1100 for\n<code>millisecondsValue</code>, the seconds stored in the Date object will be incremented by 1, and 100 will\nbe used for milliseconds.</p>\n\n<pre><code>theBigDay = new Date();\ntheBigDay.setUTCMilliseconds(500);\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>millisecondsValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>A number between 0 and 999, representing the milliseconds.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>New date represented as milliseconds.</p>\n</div></li></ul></div></div></div><div id='method-setUTCMinutes' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-setUTCMinutes' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-setUTCMinutes' cl***REMOVED***='name expandable'>setUTCMinutes</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> minutesValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> secondsValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> msValue</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Sets the minutes (0-59) for a specified date according to universal time. ...</div><div cl***REMOVED***='long'><p>Sets the minutes (0-59) for a specified date according to universal time.</p>\n\n<p>If you do not specify the <code>secondsValue</code> and <code>msValue</code> parameters, the values returned from\n<code>getUTCSeconds</code> and <code>getUTCMilliseconds</code> methods are used.</p>\n\n<p>If a parameter you specify is outside of the expected range, <code>setUTCMinutes</code> attempts to update the\ndate information in the <code>Date</code> object accordingly. For example, if you use 100 for <code>secondsValue</code>,\nthe minutes (<code>minutesValue</code>) will be incremented by 1 (<code>minutesValue</code> + 1), and 40 will be used for\nseconds.</p>\n\n<pre><code>theBigDay = new Date();\ntheBigDay.setUTCMinutes(43);\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>minutesValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 59, representing the minutes.</p>\n</div></li><li><span cl***REMOVED***='pre'>secondsValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 59, representing the seconds. If you specify the <code>secondsValue</code> parameter, you must also specify the <code>minutesValue</code>.</p>\n</div></li><li><span cl***REMOVED***='pre'>msValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>A number between 0 and 999, representing the milliseconds. If you specify the <code>msValue</code> parameter, you must also specify the <code>minutesValue</code> and <code>secondsValue</code>.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>New date represented as milliseconds.</p>\n</div></li></ul></div></div></div><div id='method-setUTCMonth' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-setUTCMonth' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-setUTCMonth' cl***REMOVED***='name expandable'>setUTCMonth</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> monthValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> dayValue</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Sets the month (0-11) for a specified date according to universal time. ...</div><div cl***REMOVED***='long'><p>Sets the month (0-11) for a specified date according to universal time.</p>\n\n<p>If you do not specify the <code>dayValue</code> parameter, the value returned from the <code>getUTCDate</code> method is\nused.</p>\n\n<p>If a parameter you specify is outside of the expected range, <code>setUTCMonth</code> attempts to update the\ndate information in the <code>Date</code> object accordingly. For example, if you use 15 for <code>monthValue</code>, the\nyear will be incremented by 1 (year + 1), and 3 will be used for month.</p>\n\n<pre><code>theBigDay = new Date();\ntheBigDay.setUTCMonth(11);\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>monthValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 11, representing the months January through\nDecember.</p>\n</div></li><li><span cl***REMOVED***='pre'>dayValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer from 1 to 31, representing the day of the month.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>New date represented as milliseconds.</p>\n</div></li></ul></div></div></div><div id='method-setUTCSeconds' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-setUTCSeconds' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-setUTCSeconds' cl***REMOVED***='name expandable'>setUTCSeconds</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> secondsValue, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> msValue</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Sets the seconds (0-59) for a specified date according to universal time. ...</div><div cl***REMOVED***='long'><p>Sets the seconds (0-59) for a specified date according to universal time.</p>\n\n<p>If you do not specify the <code>msValue</code> parameter, the value returned from the <code>getUTCMilliseconds</code>\nmethods is used.</p>\n\n<p>If a parameter you specify is outside of the expected range, <code>setUTCSeconds</code> attempts to update the\ndate information in the <code>Date</code> object accordingly. For example, if you use 100 for <code>secondsValue</code>,\nthe minutes stored in the <code>Date</code> object will be incremented by 1, and 40 will be used for seconds.</p>\n\n<pre><code>theBigDay = new Date();\ntheBigDay.setUTCSeconds(20);\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>secondsValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 59.</p>\n</div></li><li><span cl***REMOVED***='pre'>msValue</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>A number between 0 and 999, representing the milliseconds.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>New date represented as milliseconds.</p>\n</div></li></ul></div></div></div><div id='method-toDateString' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-toDateString' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-toDateString' cl***REMOVED***='name expandable'>toDateString</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the \"date\" portion of the Date as a human-readable string in American English. ...</div><div cl***REMOVED***='long'><p>Returns the \"date\" portion of the Date as a human-readable string in American English.</p>\n\n<p><a href=\"#!/api/Date\" rel=\"Date\" cl***REMOVED***=\"docCl***REMOVED***\">Date</a> instances refer to a specific point in time. Calling <code>toString</code> will return the\ndate formatted in a human readable form in American English. In SpiderMonkey, this consists of the\ndate portion (day, month, and year) followed by the time portion (hours, minutes, seconds, and time\nzone). Sometimes it is desirable to obtain a string of the date portion; such a thing can be\naccomplished with the <code>toDateString</code> method.</p>\n\n<p>The <code>toDateString</code> method is especially useful because compliant engines implementing ECMA-262 may\ndiffer in the string obtained from <code>toString</code> for <code>Date</code> objects, as the format is implementation-\ndependent and simple string slicing approaches may not produce consistent results across multiple\nengines.</p>\n\n<pre><code>var d = new Date(1993, 6, 28, 14, 39, 7);\nprintln(d.toString()); // prints Wed Jul 28 1993 14:39:07 GMT-0600 (PDT)\nprintln(d.toDateString()); // prints Wed Jul 28 1993\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a></span><div cl***REMOVED***='sub-desc'><p>Human-readable string, in local time.</p>\n</div></li></ul></div></div></div><div id='method-toLocaleDateString' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-toLocaleDateString' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-toLocaleDateString' cl***REMOVED***='name expandable'>toLocaleDateString</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the \"date\" portion of the Date as a string, using the current locale's\nconventions. ...</div><div cl***REMOVED***='long'><p>Returns the \"date\" portion of the Date as a string, using the current locale's\nconventions.</p>\n\n<p>The <code>toLocaleDateString</code> method relies on the underlying operating system in formatting dates. It\nconverts the date to a string using the formatting convention of the operating system where the\nscript is running. For example, in the United States, the month appears before the date (04/15/98),\nwhereas in Germany the date appears before the month (15.04.98). If the operating system is not\nyear-2000 compliant and does not use the full year for years before 1900 or over 2000,\n<code>toLocaleDateString</code> returns a string that is not year-2000 compliant. <code>toLocaleDateString</code> behaves\nsimilarly to <code>toString</code> when converting a year that the operating system does not properly format.</p>\n\n<p>Methods such as <code>getDate</code>, <code>getMonth</code>, and <code>getFullYear</code> give more portable results than\n<code>toLocaleDateString</code>. Use <code>toLocaleDateString</code> when the intent is to display to the user a string\nformatted using the regional format chosen by the user. Be aware that this method, due to its\nnature, behaves differently depending on the operating system and on the user's settings.</p>\n\n<p>In the following example, <code>today</code> is a <code>Date</code> object:</p>\n\n<pre><code>today = new Date(95,11,18,17,28,35) //months are represented by 0 to 11\ntoday.toLocaleDateString()\n</code></pre>\n\n<p>In this example, <code>toLocaleDateString</code> returns a string value that is similar to the following form.\nThe exact format depends on the platform, locale and user's settings.</p>\n\n<pre><code>12/18/95\n</code></pre>\n\n<p>You shouldn't use this method in contexts where you rely on a particular format or locale.</p>\n\n<pre><code>\"Last visit: \" + someDate.toLocaleDateString(); // Good example\n\"Last visit was at \" + someDate.toLocaleDateString(); // Bad example\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a></span><div cl***REMOVED***='sub-desc'><p>Human-readable string that may be formatted differently depending\non the country.</p>\n</div></li></ul></div></div></div><div id='method-toLocaleString' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-toLocaleString' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-toLocaleString' cl***REMOVED***='name expandable'>toLocaleString</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Converts a date to a string, using the current locale's conventions. ...</div><div cl***REMOVED***='long'><p>Converts a date to a string, using the current locale's conventions. Overrides\nthe <code><a href=\"#!/api/Object-method-toLocaleString\" rel=\"Object-method-toLocaleString\" cl***REMOVED***=\"docCl***REMOVED***\">Object.toLocaleString</a></code> method.</p>\n\n<p>The <code>toLocaleString</code> method relies on the underlying operating system in formatting dates. It\nconverts the date to a string using the formatting convention of the operating system where the\nscript is running. For example, in the United States, the month appears before the date (04/15/98),\nwhereas in Germany the date appears before the month (15.04.98). If the operating system is not\nyear-2000 compliant and does not use the full year for years before 1900 or over 2000,\n<code>toLocaleString</code> returns a string that is not year-2000 compliant. <code>toLocaleString</code> behaves\nsimilarly to <code>toString</code> when converting a year that the operating system does not properly format.</p>\n\n<p>Methods such as <code>getDate</code>, <code>getMonth</code>, <code>getFullYear</code>, <code>getHours</code>, <code>getMinutes</code>, and <code>getSeconds</code>\ngive more portable results than <code>toLocaleString</code>. Use <code>toLocaleString</code> when the intent is to\ndisplay to the user a string formatted using the regional format chosen by the user. Be aware that\nthis method, due to its nature, behaves differently depending on the operating system and on the\nuser's settings.</p>\n\n<p>In the following example, <code>today</code> is a <code>Date</code> object:</p>\n\n<pre><code>today = new Date(95,11,18,17,28,35); //months are represented by 0 to 11\ntoday.toLocaleString();\n</code></pre>\n\n<p>In this example, <code>toLocaleString</code> returns a string value that is similar to the following form. The\nexact format depends on the platform, locale and user's settings.</p>\n\n<pre><code>12/18/95 17:28:35\n</code></pre>\n\n<p>You shouldn't use this method in contexts where you rely on a particular format or locale.</p>\n\n<pre><code>\"Last visit: \" + someDate.toLocaleString(); // Good example\n\"Last visit was at \" + someDate.toLocaleString(); // Bad example\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a></span><div cl***REMOVED***='sub-desc'><p>Human-readable string that may be formatted differently depending\non the country.</p>\n</div></li></ul></div></div></div><div id='method-toLocaleTimeString' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-toLocaleTimeString' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-toLocaleTimeString' cl***REMOVED***='name expandable'>toLocaleTimeString</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the \"time\" portion of the Date as a string, using the current locale's\nconventions. ...</div><div cl***REMOVED***='long'><p>Returns the \"time\" portion of the Date as a string, using the current locale's\nconventions.</p>\n\n<p>The <code>toLocaleTimeString</code> method relies on the underlying operating system in formatting dates. It\nconverts the date to a string using the formatting convention of the operating system where the\nscript is running. For example, in the United States, the month appears before the date (04/15/98),\nwhereas in Germany the date appears before the month (15.04.98).</p>\n\n<p>Methods such as <code>getHours</code>, <code>getMinutes</code>, and <code>getSeconds</code> give more consistent results than\n<code>toLocaleTimeString</code>. Use <code>toLocaleTimeString</code> when the intent is to display to the user a string\nformatted using the regional format chosen by the user. Be aware that this method, due to its\nnature, behaves differently depending on the operating system and on the user's settings.</p>\n\n<p>In the following example, <code>today</code> is a <code>Date</code> object:</p>\n\n<pre><code>today = new Date(95,11,18,17,28,35) //months are represented by 0 to 11\ntoday.toLocaleTimeString()\n</code></pre>\n\n<p>In this example, <code>toLocaleTimeString</code> returns a string value that is similar to the following form.\nThe exact format depends on the platform.</p>\n\n<pre><code>17:28:35\n</code></pre>\n\n<p>You shouldn't use this method in contexts where you rely on a particular format or locale.</p>\n\n<pre><code>\"Last visit: \" + someDate.toLocaleTimeString(); // Good example\n\"Last visit was at \" + someDate.toLocaleTimeString(); // Bad example\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a></span><div cl***REMOVED***='sub-desc'><p>Human-readable string that may be formatted differently depending\non the country.</p>\n</div></li></ul></div></div></div><div id='method-toString' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-toString' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-toString' cl***REMOVED***='name expandable'>toString</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns a string representing the specified Date object. ...</div><div cl***REMOVED***='long'><p>Returns a string representing the specified Date object. Overrides the\n<code>Object.prototype.toString</code> method.</p>\n\n<p>The <code>Date</code> object overrides the toString method of the Object object; it does not inherit\n<code><a href=\"#!/api/Object-method-toString\" rel=\"Object-method-toString\" cl***REMOVED***=\"docCl***REMOVED***\">Object.toString</a></code>. For <code>Date</code> objects, the <code>toString</code> method returns a string representation of the\nobject.</p>\n\n<p><code>toString</code> always returns a string representation of the date in American English.</p>\n\n<p>JavaScript calls the <code>toString</code> method automatically when a date is to be represented as a text\nvalue or when a date is referred to in a string concatenation.</p>\n\n<p>The following ***REMOVED***igns the <code>toString</code> value of a <code>Date</code> object to <code>myVar</code>:</p>\n\n<pre><code>x = new Date();\nmyVar=x.toString();   //***REMOVED***igns a value to myVar similar to:\n//Mon Sep 28 1998 14:36:22 GMT-0700 (Pacific Daylight Time)\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a></span><div cl***REMOVED***='sub-desc'><p>Human-readable string of the date in local time.</p>\n</div></li></ul></div></div></div><div id='method-toTimeString' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-toTimeString' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-toTimeString' cl***REMOVED***='name expandable'>toTimeString</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the \"time\" portion of the Date as a human-readable string. ...</div><div cl***REMOVED***='long'><p>Returns the \"time\" portion of the Date as a human-readable string.</p>\n\n<p><a href=\"#!/api/Date\" rel=\"Date\" cl***REMOVED***=\"docCl***REMOVED***\">Date</a> instances refer to a specific point in time. Calling <code>toString</code> will return the\ndate formatted in a human readable form in American English. In SpiderMonkey, this consists of the\ndate portion (day, month, and year) followed by the time portion (hours, minutes, seconds, and\ntime zone). Sometimes it is desirable to obtain a string of the time portion; such a thing can be\naccomplished with the <code>toTimeString</code> method.</p>\n\n<p>The <code>toTimeString</code> method is especially useful because compliant engines implementing ECMA-262 may\ndiffer in the string obtained from <code>toString</code> for <code>Date</code> objects, as the format is implementation-\ndependent; simple string slicing approaches may not produce consistent results across multiple\nengines.</p>\n\n<pre><code>var d = new Date(1993, 6, 28, 14, 39, 7);\nprintln(d.toString()); // prints Wed Jul 28 1993 14:39:07 GMT-0600 (PDT)\nprintln(d.toTimeString()); // prints 14:39:07 GMT-0600 (PDT)\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a></span><div cl***REMOVED***='sub-desc'><p>Human-readable string of the date in local time.</p>\n</div></li></ul></div></div></div><div id='method-toUTCString' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-toUTCString' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-toUTCString' cl***REMOVED***='name expandable'>toUTCString</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Converts a date to a string, using the universal time convention. ...</div><div cl***REMOVED***='long'><p>Converts a date to a string, using the universal time convention.</p>\n\n<p>The value returned by <code>toUTCString</code> is a readable string in American English in the UTC time zone.\nThe format of the return value may vary according to the platform.</p>\n\n<pre><code>var today = new Date();\nvar UTCstring = today.toUTCString();\n// Mon, 03 Jul 2006 21:44:38 GMT\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a></span><div cl***REMOVED***='sub-desc'><p>String of the date in UTC.</p>\n</div></li></ul></div></div></div><div id='method-valueOf' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-method-valueOf' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-method-valueOf' cl***REMOVED***='name expandable'>valueOf</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the primitive value of a Date object. ...</div><div cl***REMOVED***='long'><p>Returns the primitive value of a Date object. Overrides the\nObject.prototype.valueOf method.</p>\n\n<p>The <code>valueOf</code> method returns the primitive value of a <code>Date</code> object as a number data type, the\nnumber of milliseconds since midnight 01 January, 1970 UTC.</p>\n\n<p>This method is functionally equivalent to the <code>getTime</code> method.</p>\n\n<p>This method is usually called internally by JavaScript and not explicitly in code.</p>\n\n<pre><code>x = new Date(56, 6, 17);\nmyVar = x.valueOf();      //***REMOVED***igns -424713600000 to myVar\n</code></pre>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Date represented as milliseconds.</p>\n</div></li></ul></div></div></div></div><div cl***REMOVED***='subsection'><div cl***REMOVED***='definedBy'>Defined By</div><h4 cl***REMOVED***='members-subtitle'>Static Methods</h3><div id='static-method-UTC' cl***REMOVED***='member first-child not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-static-method-UTC' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-static-method-UTC' cl***REMOVED***='name expandable'>UTC</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> year, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> month, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> date, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> hrs, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> min, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> sec, <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a> ms</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><strong cl***REMOVED***='static signature'>static</strong></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Accepts the same parameters as the longest form of the constructor, and returns\nthe number of milliseconds in a Date ...</div><div cl***REMOVED***='long'><p>Accepts the same parameters as the longest form of the constructor, and returns\nthe number of milliseconds in a <code>Date</code> object since January 1, 1970, 00:00:00,\nuniversal time.</p>\n\n<p><code>UTC</code> takes comma-delimited date parameters and returns the number of milliseconds between January\n1, 1970, 00:00:00, universal time and the time you specified.</p>\n\n<p>You should specify a full year for the year; for example, 1998. If a year between 0 and 99 is\nspecified, the method converts the year to a year in the 20th century (1900 + year); for example,\nif you specify 95, the year 1995 is used.</p>\n\n<p>The <code>UTC</code> method differs from the <code>Date</code> constructor in two ways.\n*   <code><a href=\"#!/api/Date-static-method-UTC\" rel=\"Date-static-method-UTC\" cl***REMOVED***=\"docCl***REMOVED***\">Date.UTC</a></code> uses universal time instead of the local time.\n*   <code><a href=\"#!/api/Date-static-method-UTC\" rel=\"Date-static-method-UTC\" cl***REMOVED***=\"docCl***REMOVED***\">Date.UTC</a></code> returns a time value as a number instead of creating a <code>Date</code> object.</p>\n\n<p>If a parameter you specify is outside of the expected range, the <code>UTC</code> method updates the other\nparameters to allow for your number. For example, if you use 15 for month, the year will be\nincremented by 1 (year + 1), and 3 will be used for the month.</p>\n\n<p>Because <code>UTC</code> is a static method of <code>Date</code>, you always use it as <code><a href=\"#!/api/Date-static-method-UTC\" rel=\"Date-static-method-UTC\" cl***REMOVED***=\"docCl***REMOVED***\">Date.UTC</a>()</code>, rather than as a\nmethod of a <code>Date</code> object you created.</p>\n\n<p>The following statement creates a <code>Date</code> object using GMT instead of local time:</p>\n\n<pre><code>gmtDate = new Date(<a href=\"#!/api/Date-static-method-UTC\" rel=\"Date-static-method-UTC\" cl***REMOVED***=\"docCl***REMOVED***\">Date.UTC</a>(96, 11, 1, 0, 0, 0));\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>year</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>A year after 1900.</p>\n</div></li><li><span cl***REMOVED***='pre'>month</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 11 representing the month.</p>\n</div></li><li><span cl***REMOVED***='pre'>date</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 1 and 31 representing the day of the month.</p>\n</div></li><li><span cl***REMOVED***='pre'>hrs</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 23 representing the hours.</p>\n</div></li><li><span cl***REMOVED***='pre'>min</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 59 representing the minutes.</p>\n</div></li><li><span cl***REMOVED***='pre'>sec</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 59 representing the seconds.</p>\n</div></li><li><span cl***REMOVED***='pre'>ms</span> : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><div cl***REMOVED***='sub-desc'><p>An integer between 0 and 999 representing the milliseconds.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Number of milliseconds since January 1, 1970, 00:00:00, universal time.</p>\n</div></li></ul></div></div></div><div id='static-method-now' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-static-method-now' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-static-method-now' cl***REMOVED***='name expandable'>now</a>( <span cl***REMOVED***='pre'></span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><strong cl***REMOVED***='static signature'>static</strong></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Returns the numeric value corresponding to the current time. ...</div><div cl***REMOVED***='long'><p>Returns the numeric value corresponding to the current time.</p>\n\n<p>The <code>now</code> method returns the milliseconds elapsed since 1 January 1970 00:00:00 UTC up until now as\na number.</p>\n\n<p>When using <code>now</code> to create timestamps or unique IDs, keep in mind that the resolution may be 15\nmilliseconds on Windows, so you could end up with several equal values if <code>now</code> is called multiple\ntimes within a short time span.</p>\n<h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Returns the number of milliseconds elapsed since 1 January 1970 00:00:00 UTC.</p>\n</div></li></ul></div></div></div><div id='static-method-parse' cl***REMOVED***='member  not-inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><span cl***REMOVED***='defined-in' rel='Date'>Date</span><br/><a href='source/Date.html#Date-static-method-parse' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Date-static-method-parse' cl***REMOVED***='name expandable'>parse</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a> dateString</span> ) : <a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a><strong cl***REMOVED***='static signature'>static</strong></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Parses a string representation of a date, and returns the number of milliseconds\nsince January 1, 1970, 00:00:00, loc...</div><div cl***REMOVED***='long'><p>Parses a string representation of a date, and returns the number of milliseconds\nsince January 1, 1970, 00:00:00, local time.</p>\n\n<p>The <code>parse</code> method takes a date string (such as <code>\"Dec 25, 1995\"</code>) and returns the number of\nmilliseconds since January 1, 1970, 00:00:00 UTC. The local time zone is used to interpret\narguments that do not contain time zone information. This function is useful for setting date\nvalues based on string values, for example in conjunction with the <code>setTime</code> method and the\n<a href=\"#!/api/Date\" rel=\"Date\" cl***REMOVED***=\"docCl***REMOVED***\">Date</a> object.</p>\n\n<p>Given a string representing a time, parse returns the time value. It accepts the IETF standard (RFC\n1123 Section 5.2.14 and elsewhere) date syntax: <code>\"Mon, 25 Dec 1995 13:30:00 GMT\"</code>. It understands\nthe continental US time-zone abbreviations, but for general use, use a time-zone offset, for\nexample, <code>\"Mon, 25 Dec 1995 13:30:00 GMT+0430\"</code> (4 hours, 30 minutes east of the Greenwich\nmeridian). If you do not specify a time zone, the local time zone is ***REMOVED***umed. GMT and UTC are\nconsidered equivalent.</p>\n\n<h3>Using parse</h3>\n\n<p>If <code>IPOdate</code> is an existing <code>Date</code> object, then you can set it to August 9, 1995 (local time) as\nfollows:</p>\n\n<pre><code>IPOdate.setTime(<a href=\"#!/api/Date-static-method-parse\" rel=\"Date-static-method-parse\" cl***REMOVED***=\"docCl***REMOVED***\">Date.parse</a>(\"Aug 9, 1995\"));\n</code></pre>\n\n<p>Some other examples:</p>\n\n<pre><code>// Returns 807937200000 in time zone GMT-0300, and other values in other\n// timezones, since the argument does not specify a time zone.\n<a href=\"#!/api/Date-static-method-parse\" rel=\"Date-static-method-parse\" cl***REMOVED***=\"docCl***REMOVED***\">Date.parse</a>(\"Aug 9, 1995\");\n\n// Returns 807926400000 no matter the local time zone.\n<a href=\"#!/api/Date-static-method-parse\" rel=\"Date-static-method-parse\" cl***REMOVED***=\"docCl***REMOVED***\">Date.parse</a>(\"Wed, 09 Aug 1995 00:00:00 GMT\");\n\n// Returns 807937200000 in timezone GMT-0300, and other values in other\n// timezones, since there is no time zone specifier in the argument.\n<a href=\"#!/api/Date-static-method-parse\" rel=\"Date-static-method-parse\" cl***REMOVED***=\"docCl***REMOVED***\">Date.parse</a>(\"Wed, 09 Aug 1995 00:00:00\");\n\n// Returns 0 no matter the local time zone.\n<a href=\"#!/api/Date-static-method-parse\" rel=\"Date-static-method-parse\" cl***REMOVED***=\"docCl***REMOVED***\">Date.parse</a>(\"Thu, 01 Jan 1970 00:00:00 GMT\");\n\n// Returns 14400000 in timezone GMT-0400, and other values in other\n// timezones, since there is no time zone specifier in the argument.\n<a href=\"#!/api/Date-static-method-parse\" rel=\"Date-static-method-parse\" cl***REMOVED***=\"docCl***REMOVED***\">Date.parse</a>(\"Thu, 01 Jan 1970 00:00:00\");\n\n// Returns 14400000 no matter the local time zone.\n<a href=\"#!/api/Date-static-method-parse\" rel=\"Date-static-method-parse\" cl***REMOVED***=\"docCl***REMOVED***\">Date.parse</a>(\"Thu, 01 Jan 1970 00:00:00 GMT-0400\");\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>dateString</span> : <a href=\"#!/api/String\" rel=\"String\" cl***REMOVED***=\"docCl***REMOVED***\">String</a><div cl***REMOVED***='sub-desc'><p>A string representing a date.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Number\" rel=\"Number\" cl***REMOVED***=\"docCl***REMOVED***\">Number</a></span><div cl***REMOVED***='sub-desc'><p>Number of milliseconds since January 1, 1970, 00:00:00, local time.</p>\n</div></li></ul></div></div></div></div></div></div></div>","subcl***REMOVED***es":[],"name":"Date","alternateCl***REMOVED***Names":[],"inheritdoc":null,"files":[{"href":"Date.html#Date","filename":"Date.js"}],"html_meta":{},"singleton":false,"id":"cl***REMOVED***-Date","statics":{"property":[],"event":[],"css_var":[],"method":[{"meta":{"static":true},"owner":"Date","tagname":"method","name":"UTC","id":"static-method-UTC"},{"meta":{"static":true},"owner":"Date","tagname":"method","name":"now","id":"static-method-now"},{"meta":{"static":true},"owner":"Date","tagname":"method","name":"parse","id":"static-method-parse"}],"css_mixin":[],"cfg":[]},"requires":[]});